import { Project } from "./Project";
import 'animate.css';

export function ProjectList({img, Name, Overview, Url, lists}) {
    let imagePath = '../assets/Img/'
    return(
        <section id="Works">
            {
                lists.map((work, index) => {
                    return <Project
                        img={work.src}
                        Name={work.Title}
                        Overview={work.desc}
                        Url={work.url}
                        animation_delay={index}
                    />
                })
            }        
        </section>
    )
}
